import React from 'react'
import SearchBox from './SearchBox'

class Header extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div className="header-wrapper light-border-bottom drop-shadow">
        <div className="constrained-width">
          <img className="logo logo-sm" src="/images/logo.png" />
          <SearchBox />
          <div className="leaderboard-menu-link inline-block">
            <p className="font-color-light-grey inline-block">Leaderboard</p>
          </div>
          <div className="float-right inline-block">
            <img className="avatar avatar-sm" src="https://pbs.twimg.com/profile_images/822547732376207360/5g0FC8XX.jpg" />
          </div>
        </div>
      </div>
    )
  }
}

export default Header
